import React from 'react';
import './App.css';
import Navbar from './Navbar';
import Footer from './Footer';

function App() {
  return (
    <div className="about-container">
      <div className="about-image">
        <img src="/profile.jpg" alt="My Profile" />
      </div>
      <div className="about-content">
        <h2>About Me</h2>
        <p>
          Hi there! I'm [Your Name], a passionate [Your Profession]. I love [Your Interests/Hobbies].
          I have experience in [Your Relevant Experience]. I'm excited to share my knowledge and
          learn from others in the [Tech/Programming/Industry] community.
        </p>
      </div>
    </div>
  );
}

export default App;
